import React, { useState, useRef } from "react";
import axios from "../utils/axiosInstance";
import Layout from "../components/Layout";
import { Link } from "react-router-dom";
import {
  AlertTriangle,
  CheckCircle,
  Info,
  FileText,
  Text,
  Globe,
  Sparkles,
  UploadCloud
} from "lucide-react";
import "../styles/global.css";

const Analyser = () => {
  const [mode, setMode] = useState("url");
  const [url, setUrl] = useState("");
  const [policyText, setPolicyText] = useState("");
  const [analysis, setAnalysis] = useState(null);
  const [textAnalysis, setTextAnalysis] = useState(null);
  const [loading, setLoading] = useState(false);
  const resultRef = useRef(null);

  const handleURLAnalyze = async () => {
    if (!url) return alert("Indtast en URL");
    setLoading(true);
    try {
      const res = await axios.post("/gdpr/analyze", { url });
      setAnalysis(res.data);
      setTimeout(() => {
        resultRef.current?.scrollIntoView({ behavior: "smooth" });
      }, 100);
    } catch (err) {
      alert("Analyse fejlede");
    } finally {
      setLoading(false);
    }
  };

  const handleTextAnalyze = async () => {
    if (!policyText.trim()) return;
    setLoading(true);
    try {
      const res = await axios.post("/enhancer/analyze-text", { text: policyText });
      setTextAnalysis(res.data);
      setTimeout(() => {
        resultRef.current?.scrollIntoView({ behavior: "smooth" });
      }, 100);
    } catch (err) {
      alert("Tekstanalyse fejlede");
    } finally {
      setLoading(false);
    }
  };

  return (
    <Layout>
      <div className="grid grid-cols-1 md:grid-cols-2 gap-6 max-w-6xl mx-auto mt-8">
        {/* URL analyse */}
        <div className="card">
          <h2 className="text-xl font-semibold mb-4 flex items-center gap-2">
            <Globe size={18} /> Analyse af hjemmeside
          </h2>
          <input
            type="text"
            placeholder="https://www.eksempel.dk"
            value={url}
            onChange={(e) => setUrl(e.target.value)}
            className="form-field mb-3"
          />
          <button onClick={handleURLAnalyze} disabled={loading}>
            {loading ? "Analyserer..." : "🔎 Start URL-analyse"}
          </button>
        </div>

        {/* Politiktekst analyse */}
        <div className="card">
          <h2 className="text-xl font-semibold mb-4 flex items-center gap-2">
            <Text size={18} /> Analyse af politiktekst
          </h2>
          <textarea
            rows={8}
            placeholder="Indsæt din nuværende politiktekst her..."
            value={policyText}
            onChange={(e) => setPolicyText(e.target.value)}
            className="form-field mb-3"
          />
          <button onClick={handleTextAnalyze} disabled={loading}>
            {loading ? "Analyserer..." : "📄 Analyser tekst"}
          </button>
        </div>
      </div>

      {/* URL Analyse result */}
      {analysis && (
        <div ref={resultRef} className="card max-w-3xl mx-auto mt-8">
          <h3 className="text-lg font-bold mb-2">🌐 Resultat af URL-analyse</h3>
          <p>
            <strong>Compliance Score:</strong>{" "}
            <span className="score-badge" style={{
              backgroundColor: analysis.score >= 90 ? "#22C55E" : analysis.score >= 70 ? "#FACC15" : "#EF4444",
              color: "#fff"
            }}>{analysis.score}%</span>
          </p>
          <p className="mt-2">
            {analysis.missing?.length > 0 ? "🔸 Mangler: " + analysis.missing.join(", ") : "✔️ Ingen større problemer fundet"}
          </p>

          {analysis.suggestions?.length > 0 && (
            <>
              <p className="mt-4 font-semibold">Forslag til forbedring:</p>
              <ul className="list-disc pl-6 mt-2">
                {analysis.suggestions.map((s, i) => (
                  <li key={i}>{s}</li>
                ))}
              </ul>
              <Link
                to="/ai-generator"
                className="inline-block mt-4 px-4 py-2 bg-blue-600 text-white rounded-md hover:bg-blue-700"
              >
                Forbedr politik med AI <Sparkles size={16} className="inline ml-2" />
              </Link>
            </>
          )}
        </div>
      )}

      {/* Tekst analyse result */}
      {textAnalysis && (
        <div ref={resultRef} className="card max-w-3xl mx-auto mt-8">
          <h3 className="text-lg font-bold mb-2">📄 Analyse af politiktekst</h3>
          <ul className="list-disc pl-6">
            {textAnalysis.recommendations.map((rec, i) => (
              <li key={i}>{rec}</li>
            ))}
          </ul>
          <Link
            to="/ai-generator"
            className="inline-block mt-4 px-4 py-2 bg-blue-600 text-white rounded-md hover:bg-blue-700"
          >
            Forbedr min politik med AI <Sparkles size={16} className="inline ml-2" />
          </Link>
        </div>
      )}
    </Layout>
  );
};

export default Analyser;
